var _Init9ebb1213fd4335ec7426896a1e1ab26abdd33f59 = ".PHONY: build build-alpine clean test help default\n\nBIN_NAME={{ .app_name }}\n\nVERSION := $(shell grep \"const Version \" version/version.go | sed -E 's/.*\"(.+)\"$$/\\1/')\nGIT_COMMIT=$(shell git rev-parse HEAD)\nGIT_DIRTY=$(shell test -n \"`git status --porcelain`\" && echo \"+CHANGES\" || true)\nBUILD_DATE=$(shell date '+%Y-%m-%d-%H:%M:%S')\nIMAGE_NAME := \"{{ .docker_hub_username }}/{{ .app_name }}\"\n\ndefault: test\n\nhelp:\n\t@echo 'Management commands for {{ .app_name }}:'\n\t@echo\n\t@echo 'Usage:'\n\t@echo '    make build           Compile the project.'\n\t@echo '    make get-deps        runs dep ensure, mostly used for ci.'\n\t{% if .use_docker == \"y\" %}@echo '    make build-alpine    Compile optimized for alpine linux.'\n\t@echo '    make package         Build final docker image with just the go binary inside'\n\t@echo '    make tag             Tag image created by package with latest, git commit and version'\n\t@echo '    make test            Run tests on a compiled project.'\n\t@echo '    make push            Push tagged images to registry'{% endif %}\n\t@echo '    make clean           Clean the directory tree.'\n\t@echo\n\nbuild:\n\t@echo \"building ${BIN_NAME} ${VERSION}\"\n\t@echo \"GOPATH=${GOPATH}\"\n\tgo build -ldflags \"-X github.com/{{ .github_username }}/{{ .app_name }}/version.GitCommit=${GIT_COMMIT}${GIT_DIRTY} -X github.com/{{ .github_username }}/{{ .app_name }}/version.BuildDate=${BUILD_DATE}\" -o bin/${BIN_NAME}\n\nget-deps:\n\tdep ensure\n{% if .use_docker == \"y\" %}\nbuild-alpine:\n\t@echo \"building ${BIN_NAME} ${VERSION}\"\n\t@echo \"GOPATH=${GOPATH}\"\n\tgo build -ldflags '-w -linkmode external -extldflags \"-static\" -X github.com/{{ .github_username }}/{{ .app_name }}/version.GitCommit=${GIT_COMMIT}${GIT_DIRTY} -X github.com/{{ .github_username }}/{{ .app_name }}/version.BuildDate=${BUILD_DATE}' -o bin/${BIN_NAME}\n\npackage:\n\t@echo \"building image ${BIN_NAME} ${VERSION} $(GIT_COMMIT)\"\n\tdocker build --build-arg VERSION=${VERSION} --build-arg GIT_COMMIT=$(GIT_COMMIT) -t $(IMAGE_NAME):local .\n\ntag:\n\t@echo \"Tagging: latest ${VERSION} $(GIT_COMMIT)\"\n\tdocker tag $(IMAGE_NAME):local $(IMAGE_NAME):$(GIT_COMMIT)\n\tdocker tag $(IMAGE_NAME):local $(IMAGE_NAME):${VERSION}\n\tdocker tag $(IMAGE_NAME):local $(IMAGE_NAME):latest\n\npush: tag\n\t@echo \"Pushing docker image to registry: latest ${VERSION} $(GIT_COMMIT)\"\n\tdocker push $(IMAGE_NAME):$(GIT_COMMIT)\n\tdocker push $(IMAGE_NAME):${VERSION}\n\tdocker push $(IMAGE_NAME):latest\n{% endif %}\nclean:\n\t@test ! -e bin/${BIN_NAME} || rm bin/${BIN_NAME}\n\ntest:\n\tgo test ./...\n"
